<template>
  <v-row>
    <v-col cols="12">
      <v-text-field 
        @keypress.enter='searchAddress' 
        v-model="address" 
        label='주소 검색'>
      </v-text-field>
    </v-col>


    <v-col cols="6">
      <v-btn > 
        <v-icon>
          mdi-cog-outline
        </v-icon>
      </v-btn>
    </v-col>

    <v-col cols="6">
      <v-btn @click="moveLocation"> 
        <v-icon>
          mdi-apple-safari
        </v-icon>
      </v-btn>
    </v-col>
    


    
    <v-col cols="3"
      class="d-flex justify-center"
      v-for="(name, i) in distances" 
      :key=i
    >
      <v-img
        :src='name.src'
        height="100px"
        width="100px">
      </v-img>   
    
    </v-col>

  </v-row>
</template>

<script>
export default {
  data() {
    return {
      myLocation: {
        lat: '',
        lng: '',
      },
      address: '',
      distances: [],
      positions : [
        {
          title: '카카오', 
          latlng: new kakao.maps.LatLng(33.450705, 126.570677),
          src: 'data:image/jpeg;base64,'
        },
        {
          title: '생태연못', 
          latlng: new kakao.maps.LatLng(33.450936, 126.569477),
          src: 'data:image/jpeg;base64,'
        },
        {
          title: '텃밭', 
          latlng: new kakao.maps.LatLng(33.450879, 126.569940),
          src: 'data:image/jpeg;base64,'
        },
        {
          title: '근린공원',
          latlng: new kakao.maps.LatLng(33.451393, 126.570738),
          src: 'data:image/jpeg;base64,'
        },
        {
          title: '최애 초밥집',
          latlng: new kakao.maps.LatLng(36.358280, 127.30320581),
          src: 'data:image/jpeg;base64,'
        },
          {
          title: '우리 집',
          latlng: new kakao.maps.LatLng(36.3586873, 127.30278400),
          src: 'data:image/jpeg;base64,'
        }
      ]
    }
  },
  mounted() {
    window.kakao && window.kakao.maps
      ? this.initMap()
      : this.addKakaoMapScript();
  },
  methods: {
    addKakaoMapScript() {
      const script = document.createElement("script");
      /* global kakao */
      script.onload = () => kakao.maps.load(this.initMap)
      script.src =
        "http://dapi.kakao.com/v2/maps/sdk.js?autoload=false&appkey=41dd8e1c2fab039d8dbbff2e13e8d5a5";
      document.head.appendChild(script);
    },
    initMap() {
      const self = this 
      // this.$getLocation()
      // .then(coordinates => {
      //   this.myLocation = coordinates
      // })
      // .then(() => {  
      //   console.log('처음(현재)위치', self.myLocation.lat, self.myLocation.lng)
      // })
      const temp = new kakao.maps.LatLng(36.3586873, 127.30278400)
      console.log(temp)
      this.myLocation.lat= temp.Ma
      this.myLocation.lng= temp.La

      self.checkfeed()
    },
    moveLocation() {
      const self = this
      self.$getLocation()
      .then(coordinates => {
        self.myLocation = coordinates
      })
      .then(() => {
        self.map.setCenter(new kakao.maps.LatLng(self.myLocation.lat, self.myLocation.lng))
        kakao.maps.event.addListener(self.map, 'click', function(mouseEvent) {
          self.mapClick(mouseEvent)
          })
        })
      },
    searchAddress() {
      const self = this
      var geocoder = new kakao.maps.services.Geocoder()
      var callback = function(result, status) {
          if (status === kakao.maps.services.Status.OK) {
              console.log(result);
          }
      }
        
      geocoder.addressSearch(self.address, function(result, status) {

    // 정상적으로 검색이 완료됐으면 
      if (status === kakao.maps.services.Status.OK) {
        
        self.myLocation.lat = result[0].y 
        self.myLocation.lng = result[0].x
        console.log('검색위치', self.myLocation.lat, self.myLocation.lng)   
        }
      })
      self.checkfeed()
    },
    checkfeed() {
      this.distances = []
      console.log(this.positions)
      function distance(location1, location2, unit){
        let theta = location1.lng-location2.latlng.La
        let dist = Math.sin(deg2rad(location1.lat)) * Math.sin(deg2rad(location2.latlng.Ma)) + 
         Math.cos(deg2rad(location1.lat)) * Math.cos(deg2rad(location2.latlng.Ma)) * Math.cos(deg2rad(theta))

      dist = Math.acos(dist)
      dist = rad2deg(dist)
      dist = dist * 60 * 1.1515

      if (unit == "kilometer") {
        dist = dist * 1.609344
      } else if(unit == "meter"){
        dist = dist * 1609.344
      }
      return dist

      function deg2rad(deg){
      return (deg * Math.PI / 180.0)
      }
      function rad2deg(rad){
      return (rad * 180 / Math.PI)
        }
      }

      for(var i = 0; i< this.positions.length; i++ ){
        this.distances.push({'dist': distance(this.myLocation, this.positions[i], "kilometer"), 'place': this.positions[i].title, 'src': this.positions[i].src})
      }
      var sortingField = "dist"

      this.distances.sort(function(a, b) { // 오름차순
          return a[sortingField] - b[sortingField];
          
      });
    },
  }
}
</script>

